/*!50106 set global event_scheduler = 1*/;

/* Event structure for event `UpdateDepreciation` */

/*!50106 DROP EVENT IF EXISTS `UpdateDepreciation`*/;

DELIMITER $$

/*!50106 CREATE DEFINER=`root`@`localhost` EVENT `UpdateDepreciation` ON SCHEDULE EVERY 1 DAY STARTS '2024-04-09 16:59:22' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
	     UPDATE ref_kib
		    SET 
			accumulated_depreciation = accumulated_depreciation + ((acq_value - residual_value) / useful),
			book_value = book_value - ((acq_value - residual_value) / useful),
			dates_depreciation = NOW()
		    WHERE 
			 (YEAR(book_date) >= YEAR(NOW()) - useful AND DATE_ADD(IFNULL(dates_depreciation, book_date), INTERVAL 1 YEAR) = NOW());
	END */$$
DELIMITER ;

/* Procedure structure for procedure `tes` */

/*!50003 DROP PROCEDURE IF EXISTS  `tes` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `tes`()
BEGIN
    UPDATE ref_kib
    SET 
        accumulated_depreciation = accumulated_depreciation + ((acq_value - residual_value) / useful),
        book_value = book_value - ((acq_value - residual_value) / useful),
        dates_depreciation = NOW()
    WHERE 
         (YEAR(book_date) >= YEAR(NOW()) - useful AND DATE_ADD(IFNULL(dates_depreciation, book_date), INTERVAL 1 YEAR) = '2025-04-09');
        
END */$$
DELIMITER ;

/* Procedure structure for procedure `tes2` */

/*!50003 DROP PROCEDURE IF EXISTS  `tes2` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `tes2`()
BEGIN
    DECLARE acq_val DECIMAL(10, 2);
    DECLARE res_val DECIMAL(10, 2);
    DECLARE useful_life INT;
    DECLARE book_date DATE;
    DECLARE current_id INT; -- Variabel untuk menyimpan ID saat ini

    -- Deklarasi cursor untuk mengambil ID dari ref_kib
    DECLARE cur CURSOR FOR 
        SELECT id FROM ref_kib;

    -- Mengambil nilai awal dari cursor
    OPEN cur;

    -- Fetch pertama
    FETCH cur INTO current_id;

    -- Looping melalui setiap ID dalam tabel
    WHILE current_id IS NOT NULL DO
        -- Mendapatkan nilai yang diperlukan dari tabel ref_kib berdasarkan ID saat ini
        SELECT acq_value, residual_value, useful, book_date INTO acq_val, res_val, useful_life, book_date
        FROM ref_kib WHERE id = current_id;

        -- Proses update sesuai kebutuhan di sini
        -- Misalnya:
        -- IF YEAR(book_date) < YEAR(NOW()) THEN
        --     -- Lakukan sesuatu
        -- ELSE
        --     -- Lakukan sesuatu yang lain
        -- END IF;

        -- Fetch selanjutnya
        FETCH cur INTO current_id;
    END WHILE;

    -- Menutup cursor
    CLOSE cur;
END */$$
