/* Procedure structure for procedure `UpdateDepreciation` */

/*!50003 DROP PROCEDURE IF EXISTS  `UpdateDepreciation` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateDepreciation`()
BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE asset_id INT;
    DECLARE acq_val DECIMAL(10, 2);
    DECLARE res_val DECIMAL(10, 2);
    DECLARE useful_life INT;
    DECLARE book_date DATE;
    
    -- Cursor untuk mengambil setiap aset dalam tabel ref_kib
    DECLARE assets_cursor CURSOR FOR 
        SELECT id, acq_value, residual_value, useful, book_date 
        FROM ref_kib;
    
    -- Penanda untuk penutupan cursor
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    
    -- Buka cursor
    OPEN assets_cursor;
    
    -- Loop untuk mengambil dan mengupdate setiap aset
    asset_loop: LOOP
        -- Ambil data aset dari cursor
        FETCH assets_cursor INTO asset_id, acq_val, res_val, useful_life, book_date;
        
        -- Keluar dari loop jika tidak ada data lagi
        IF done THEN
            LEAVE asset_loop;
        END IF;
        
        -- Update nilai penyusutan aset
        UPDATE ref_kib
        SET 
            accumulated_depreciation = accumulated_depreciation + ((acq_val - res_val) / useful_life),
            book_value = book_value - ((acq_val - res_val) / useful_life),
            dates_depreciation = NOW()
        WHERE 
            id = asset_id and
             '2022' <= '2024';

    END LOOP;
    
    -- Tutup cursor
    CLOSE assets_cursor;
END */$$
DELIMITER ;

